import React,{useState} from 'react';
import './nav.css'

function Nav() {
    const [showLinks,setShowLinks]= useState(true);
    return (
        <div className='Navbar'>
            <div className='leftside'>
            <div className="links">
            <a className='navLogo'>logo</a>
             <a className='navService'>Service</a>
             <a className='navAboutus'>AboutUs</a>
             <a className='navOurwork'>Our Work</a>
             <a className='navContact'>Contact</a>
            </div>

            </div>

            <div className='rightside'></div>
        </div>
        
        
    );
}

export default Nav;
